import initialState from "./initialState";
import { STORE_USER } from "./users/usersTypes";

const usersReducer= (state=initialState,action)=>{
    switch(action.type){
        case STORE_USER:
            return{
                ...state,
                users:action.paylaod
            }
        default : return state;
    }
}
